descriptions:
{'es-ES': 'Viviendas exteriores a estrenar distribuidas en salón, cocina, dos dormitorios, baño y terraza.

Terminaciones muy cuidadas: Cocina totalmente amueblada y equipada con todos los electrodomésticos (lavadora, lavavajillas, horno, microondas, frigorífico, placa y campana extractora), encimera de granito, armarios empotrados en el dormitorio, pre-instalación de aire acondicionado por conductos en toda la vivienda…

Trastero y garaje incluido en el precio…'}

{'es-ES': 'Piso ubicado en la tercera planta con una superficie de 77 m2 construidos que se distribuye en hall, salón, cocina, tres habitaciones, cocina y baño. La habitación principal tiene una pequeña galería cerrada. 

La vivienda tiene los suelos de laminado, las ventanas de madera, y las puertas de pino. La cocina y baños requieren actualización. 

El inmueble se haya cerca de la Plaza de las Artes y del Colegio Público Ricardo Mur. Zona muy tranquila, cerca de Casetas y junto al Polígono Industrial El Aguila.'}

{'es-ES': 'Cliente comprador exento de honorarios adicionales.
Espectacular piso en venta. Finca en muy buen estado y muy luminosa. La vivienda con la superficie total de 101m2  y 90 m2 útoles, distribuidos en 3 dormitorios 2 cuartos de baño cocina, dos terrazas y unaplaza de garage en la misma finca.  El dormitorio principal con el cuarto de baño tipo suite y plato de ducha. El salón disfruta de amplitúd y mucha lúz. Terraza situada al lado de la cocina con facil accesos desde la misma y tambien desde el salón.  Estupenda distribución de las estancias sin pasillo. Suelos de parqué y gres. Carpintería exterior de aluminio climalít. Puertas de haya.  Un cuarto de baño con bañera. La vivienda estilo moderno con decoración y escaleras desde el salón hacía la entrada de la casa. Suministros de lúz y agua de alta. Calefacción electroca de bajo consumo. La vivienda es perfecta para inversión, por las solicitudes que tiene para alquilar. Situada en el centro del Burgo de Ebro al lado de colegio guarderia, zona de ocio parada de autobuz al lado. En una de las mejore calles con un encanto único. Eléctrica autobúz y mejores. Disponible para entrar a vivir mañana mismo. Encontramos la financiación que necesitas.

'}

{'es-ES': 'COMARCA  DE CALATAYUD.  Casa para reformar integral.Oportunidad para negocio,muchas posibilidades,maravillosas vistas y parajes para sendeismo, escalada,etc.. 

Edificio destinado a Molino,compuesto de planta baja y otra superior, con un salto hidráulico  de 40 HP,que ocupa una superficie  de 200mts2 y con varias parcelas de tierra de regadio, con un total de más  de una hectárea  de finca.
Agua de manantial que mana en la misma finca(agua  termal 27°). Muchas posibilidades para negocio,con tres balnearios en el pueblo y casas rurales.  Todos los servicios, colegio,guardería...Un entorno  natural,paisajes increíbles del cañón del río Mesa.Negociable..'}

{'es-ES': 'Piso de tres dormitorios y un cuarto de baño. Se encuentra en la primera planta de un edificio e tres alturas sobre rasante, situado en el municipio de Zaragoza, capital de provincia. 

La vivienda se compone de salón-comedor, cocina, recibidor, tres dormitorios, un cuarto de baño y recibidor. 

Zaragoza es la capital de la comunidad autónoma de Aragón. Está situada a orillas de los ríos Ebro, Huerva y Gállego y del Canal Imperial de Aragón, en el centro de un amplio valle. Su privilegiada situación geográfica la convierte en un importante nudo logístico y de comunicaciones con las carreteras N-330, N-232, además de las autopistas A-2 y A-62 y línea de AVE. Se encuentra a unos 300 km de Madrid, Barcelona, Valencia, Bilbao y Toulouse. Dispone de varias rondas circunvalatorias. Respecto transporte público dispone de red ferroviaria y diversas líneas de autobuses.'}

{'es-ES': 'Vivienda en venta en un edificio adaptado para personas con movilidad reducida en la Cl. Sangenis, paralela a Paseo Calanda. La entrada de la vivienda se sitúa a pie de calle, sin ningún tipo de escalón y el ascensor es para 6 personas.

Se trata de una segunda planta interior, compuesta por un buen salón con balcón, cocina independiente, baño con ducha y dos dormitorios, uno de ellos doble. La vivienda tiene calefacción individual de gas y los gastos de comunidad son de 55 euros mensuales. Se vende con PLAZA DE GARAJE y TRASTERO situados en el mismo edificio y con acceso a los mismos desde ascensor.

Llámenos al 976.335. 950 FINCAS ERPAS para concertar una visita.'}

{'es-ES': 'Muy bien situado, en una zona muy tranquila y despejada. Muy buenas vistas. Todo exterior, muy luminoso. Tiene una superficie útil total de 113 m2. Dispone de 2 habitaciones y 2 baños. 

Con ascensor, calefacción individual de gas natural, 2 terrazas exteriores y 1 interior, parking de 11,5 m2 y trastero incluido de 5,5 m2. Zona ajardinada con parque infantil.

Si interesa se incluyen muebles y electrodomésticos.'}

{'es-ES': 'Piso exterior 2 habitaciones, salón, cocina, baño. Céntrico y muy luminoso.

62 m2 útiles   trastero de 7 m2, totalmente reformado para entrar a vivir.

Calidades: ventanas aluminio/climalit, parquet doble tarima flotante, calefacción individual y Aire acondicionado, cocina completa, armarios a medida.'}

{'es-ES': 'Vivienda unifamiliar adosada de 155 m2 útiles distribuida en 3 plantas. Cuatro amplios dormitorios dobles, salón, cocina, baño y dos aseos. Bodega acondicionada, plaza de garaje y jardín-terraza. La está acualizada. Buen emplazamiento, junto a zona deportiva y parque infantil.

FINANCIAMOS 100% DE LA COMPRA
'}

{'es-ES': 'Si lo que estas buscando es ubicación y piso con amplitud en metros... esta puede ser tu oportunidad de comprar piso en la calle Santander, a pocos minutos andando del centro de la ciudad, en calle muy comercial, con supermercados, paradas de bus, tiendas y mas.

 El piso es de aproximadamente 90 m metros útiles, tiene 4 dormitorios, un aseo, un baño completo con plato de ducha , salón - comedor amplio, con salida a terraza acristalara con vistas a la calle Santander, ademas e incluido en el precio plaza de garaje y trastero. 

 Si necesitas hipoteca para esta propiedad , no dudes en contactarnos y te asesoramos a conseguir la que mejor te convenga. Lo visitamos?'}

{'es-ES': 'Vivienda ubicada en la Calle Reina Fabiola, en el municipio y provincia de Zaragoza.

Dispone de una superficie construida de 83 m², compuestas por recibidor, comedor, cocina, baño y 3 dormitorios. 

Zaragoza es una ciudad de aproximadamente 1.000.000 habitantes, que dispone de todos los servicios esenciales, tales como, supermercados, restaurantes, zonas de ocio, centro de salud, hoteles... Se encuentra perfectamente comunicada por carretera, cercana a A-2.'}

{'es-ES': 'Se vende piso y garaje en la urbanización Puerta de Hierro. Abstenerse inmobiliarias. 

Piso extremadamente luminoso. Suelo de mármol. 110 metros. Amplia plaza de garaje para 1 coche y 2 motos  (una de las plazas más grandes de toda la urbanización). 3 dormitorios. Gran salón super luminoso durante todo el día. Armarios empotrados en dormitorio principal y en otro dormitorio. Dos baños. Dos terrazas, una en el salón y otra en la cocina. Tiene despensa. Solo personas serias, para más información podéis llamarme 722405001 - Pablo.

La urbanización tiene grandes zonas verdes, 2 piscinas, campo de baloncesto, juegos infantiles...'}

{'es-ES': 'Ático dúplex en calle Inglaterra construcción del 2003 con muy buenas calidades, metros útiles 72m2, finca con doble puerta, ascensor en la entrada para personas con movilidad reducida, ascensor amplio y la finca consta de garaje opcional tanto de venta como de alquiler.

El piso se distribuye en la planta de abajo, hall de entrada, cocina tipo americana y salón amplio con salida a la terraza de 17m2, baño con bañera y dormitorio. En la segunda planta esta distribuida de habitación principal con armarios empotrados y baño con plato de ducha.

Cerca de todos los servicios, autobuses, supermercados, colegio y mas, cerca de Plaza Roma, Unceta, Duquesa Villahermosa, Vicente Berdusan, NO DUDE EN VISITARLO CON NOSOTROS SIN COMPROMISOS'}

{'es-ES': 'Se vende casa en Aguarón, Cariñena, a sólo 25 minutos de Zaragoza por la autovía.

La casa tiene 90 metros divididos en 2 plantas más bajo. En la planta primera, tenemos amplio salón, cocina totalmente equipada y un baño. En la segunda planta tenemos dos habitaciones, una de ellas con salida a la terraza. Y en planta calle un garaje/almacén, incluso ideal para hacer una bodega de 30 metros.

Anímate y ven a verla. Ideal para fines de semana o para vivir frecuentemente.'}

{'es-ES': 'SE VENDE!!!!!

Tercer piso, tres habitaciones, dos baños, salón, cocina equipada, aire, bomba de calor, garaje y trastero.

Info por privado.'}

{'es-ES': 'Excelente piso en calle Escoriaza y Fabro para entrar a vivir con 85m2 útiles muy bien ubicada cerca de calle Santander, paseo Teruel, av. Goya y av. valencia, con acceso a todos los servicios, autobuses, super mercados etc.

La finca consta de portero, cámaras de seguridad ascensor y ascensor para las escaleras principales que esto lo dejaría a cota cero, el piso se distribuye en 3 habitaciones dos de ellas con armario empotrado, 2 baños uno es aseo y el otro completo, cocina amplia, salón de 26m2, trastero de 3m2 y terraza, es orientación oeste a pesar de ser un piso interior entra mucha luz, ventanas de aluminio en muy buen estado, suelos de tarimas y terrazo, puertas macizas lacas de blanco, puerta de entrada blindada, calefacción central y gastos de comunidad 85€.

No dudes en concertar una visita para ver este fabuloso piso, sin ningún compromiso'}

{'es-ES': 'Piso situado al lado del Hotel Boston totalmente reformado y amueblado, para entrar a vivir o como inversión para alquilar.  No tienes que hacer nada porque la Instalación eléctrica, fontanería, suelos de tarima, puertas (incluida entrada Blindada), cocina, baño…. es todo nuevo.  Una reforma integral está todo cambiado y además con muebles que más se puede pedir.

Tiene 59 metros que incluyen 2 dormitorios, un salón, cocina, baño, recibidor, pasillo y una terraza para relajarte con su mesa, dos sillitas y césped artificial. 

Los gastos de comunidad son 60 € mensuales con ascensor, recogida de basura en la puerta de tu casa y videovigilancia (cámaras de seguridad) para sentirte más segur@'}

{'es-ES': 'HIPOTECA 100%. Este piso se encuentra en Calle Gil Morlanes, código postal  CP:50008, Zaragoza, Zaragoza, situado en el distrito de San José, en la planta 3. Es un piso, construido en el año 1940, que tiene 75 m2 de los cuales 75 m2 son útiles y dispone de 3 habitaciones y 1 baños. Piso sin ascensor. Cuenta  con una buena orientación, sur y exterior. Calefacción individual. El piso se queda tal y como se ve en fotos. Gastos de comunidad de 20€ al mes. Según estudio personal de solvencia, posibilidad del 100% de financiaciación. 


100% DE FINANCIACIÓN
Encuentra más en http://www.grupo4inmobiliaria.com'}

{'es-ES': 'Piso en la localidad de Calatayud, dentro de la provincia de Zaragoza. Localizado en un edificio de cinco plantas sobre rasante, con ascensor. La vivienda data construida en el año 1.992. 

La vivienda mide unos 116,82 m2 construidos y 91,26 m2 útiles, cuyo interior cuenta con dos dormitorios, dos baños, salón-comedor y cocina. 
El inmueble se encuentra en una zona tranquila, rodeado por viviendas residenciales de similares características. Cuenta con fácil acceso a la carretera y otros nudos de comunicación. Cercano a establecimientos y comercios de la zona.'}

{'es-ES': 'Este piso se encuentra en Plaza San Marcos , 5300, Calatayud, Zaragoza, situado en el distrito de centro, en la planta 1. Es un piso que tiene 105 m2 de los cuales 98 m2 son útiles y dispone de 4 habitaciones y 2 baños.

Se trata de un inmueble exterior y céntrico. Tiene armarios empotrados. 

Para actualizar con amplias posibilidades.'}

{'es-ES': 'Casa con 4000 m² de terreno Vallada en la población de Quinto, a 25 minutos de Zaragoza.

Acceso asfaltado. Agua sanitaria de la población.

Casa a reformar con tres habitaciones dos baños zona de jardín barbacoa, bodega, chimenea, amplio garaje, almacenes, huerto y gallinero'}

