Se incluye vivienda espaciosa y muy luminosa.'}

{'es-ES': 'Vivienda unifamiliar entre medianerías de tres plantas de altura situada en el municipio de La Viñuela, provincia de Zaragoza. 

La vivienda precisa de rehabilitación integral. Se encuentra edificada sobre una parcela de 372 m2, ocupando una superficie construida total de 444 m2 construidos. Tiene en la parte posterior de la vivienda terreno, correspondiente a derribo de una parte de la vivienda y de corral. 

El inmueble se encuentra en una zona tranquila, rodeado por viviendas residenciales de similares características. Cuenta con fácil acceso a la carretera y otros nudos de comunicación. Cercano a establecimientos y comercios de la zona.'}

{'es-ES': 'Edificio situado en la calle Boggiero, Basilio, con cuatro plantas sobre rasante, en la localidad de Zaragoza.

Edificio clasico de 1900 sin ascensor. 
La vivienda tiene unos 30 m2, un salon cocina de 20 m2,  un dormitorio que no cabe una cama de 4 m2 y t un baño pequeño.'}

{'es-ES': 'Casa de dos plantas sobre rasante que se encuentra situado en la localidad de Mallén, provincia de Zaragoza.
El edificio que data del año 1981


La vivienda se distribuye en tres dormitorios, un baño, un aseo, salon-comedor y cocina, sobre una superficie de 142.0 metros cuadrados construidos y 103.91 metros cuadrados utiles.'}

{'es-ES': 'Vivienda unifamiliar de dos plantas sobre rasante, situada en el municipio de Quinto, provincia de Zaragoza. 
La vivienda tiene una antigüedad de 107 años, construida en el año 1912.


VIvienda unifamiliar distribuida en tres dormitorios y un trastero en la planta superior  y  un baño, salon-comedor ,trastero y cocina, distribuidos en una superficie de 159.52 metros cuadrados construidos y 131.55 metros cuadrados utiles.'}

{'es-ES': 'Finca rústica en Marracos. Está dividida en dos partes: En la primera parte cocina, salon, un baño, despensa, y tres habitaciones amplias. En la segunda parte un pequeño baño de servició  que da acceso a un amplio patio interior. 
Destaca su parra que hace las veces de pérgola natural y su higuera.  Dos trasteros extra en esta parte. Desde aquí se puede acceder a la otra parte de la casa que es la parte más rústica, donde se encuentra otra habitación de matrimonio, un saloncito, otra despensa y una amplia cocina con chimenea.

PRECIO NEGOCIABLE'}

{'es-ES': 'ABSTENERSE INMOBILIARIAS.

Precio negociable.Piso en perfectas condiciones, para entrar a vivir, 68 m2. Gran salón de 29 m2 con balcón, semiabierto a cocina y distribuidor para acceso al baño, dormitorio y coqueto patio interior. Todo exterior con bonitas vigas originales en perfecto estado con factura de su mantenimiento y tratamiento que caracterizan las estancias principales. Dormitorio con aislamiento térmico y sonoro. Calefacción eléctrica, bomba de calor - aire acondicionado en el salón.

Finca antigua, primer piso sin ascensor. En pleno centro de la ciudad con vecindario tranquilo a pocas manzanas del Pilar. A una manzana de la calle Coso, con parada de autobuses y rodeado de tiendas de pequeño comercio de barrio, Eroski en la misma manzana. Posibilidad de parking en los alrededores. Instalado sistema de alarma.'}

