{'es-ES': 'Avenida de Madrid-Unceta, con ascensor. Próximo a Universidad y hospital. Pisito super-reformado,  gran salón de 30 metros con balconcito exterior a Unceta y dos dormitorios. 

Calefacción individual de gas y aire acondicionado. Armarios empotrados equipados. Líneas de bus próximas 21, 32, 51, 24, 33, 36, 52.  Si quieres verlo lo antes posible, llámanos por teléfono. 

No atendemos propuestas de compra sin una visita previa al inmueble. La permanencia del contenido mobiliario de la vivienda está sujeta a negociación. En el precio de venta no están incluidos los impuestos propios de la compraventa ni otros gastos repercutibles al comprador.  INMOBILIARIA GIL '}

