{'es-ES': 'Piso de cuatro dormitorios, salón, cocina, dos cuartos de baños y terraza/balcón. Se encuentra en la segunda planta de un edificio de 3 alturas, con ascensor, situado en el municipio de Tauste, provincia de Zaragoza, muy cerca de la Plaza de los Almogávares y la Plaza de España. La vivienda está distribuida en hall con pasillo distribuidor, cuatro habitaciones, salón, un cuarto de baño con bañera incorporado en la habitación principal y otro cuarto de baño con ducha; y cocina. El salón es exterior a la calle 21 de Abril mediante la terraza/balcón. Por su altura y orientación es una vivienda muy luminosa. Cuenta con ventanas de madera con doble acristalamiento; suelos de tarima en roble; puertas de roble; grifería monomando; videoportero; calefacción y agua caliente con caldera de gas; preinstalación de aire acondicionado; cocina con encimera de granito. Armarios empotrados en pasillo y habitación principal. Todo en muy buen estado de conservación. Se encuentra muy cerca del centro de Tauste, en zona de viviendas, a muy pocos metros de la Plaza de España y el Ayuntamiento.

102.500,00.-EUROS****WWW.GESTINFER.ES****ESPECIALISTAS EN LA VENTA DE CASAS, CHALETS, TORRES Y FINCAS***ASESORAMIENTO LEGAL Y FINANCIERO POR PROFESIONALES TITULADOS*****GESTORIA****
'}

{'es-ES': 'Piso situado en la localidad de Zaragoza. Vivienda en venta con una superficie de 70 m² distribuidos en salón-comedor, cocina independiente, 3 dormitorios y 1 baño. Dispone de cocina amueblada, radiadores, preinstalación de aire acondicionado y suelos de tarima flotante. Como anejo dispone de un trastero en la primera planta. Ubicada en una zona urbana en el centro de la localidad, cuenta con todos los servicios necesarios cercanos como, restaurantes, comercios, sucursales bancarias, centros médicos, supermercados, etc. Con muy buena comunicación pública, a menos de 3 minutos a pie encontrará una parada de autobús y se localiza a menos de 600 metros de la estación de tren Portillo, por lo que la conexión el casco antiguo de la ciudad, es de gran facilidad. Por todo ello es una gran opción para construir un hogar y entrar a vivir de inmediato. 

Empiece ahora mismo pidiendo más información. Un responsable cercano a usted le atenderá personalmente. 
#ref:PIS_4264 09'}

